import React from "react";
import { NavLink } from "react-router-dom";

import Breadcrumb from "../../../App/layout/AdminLayout/Breadcrumb";
import Aux from "../../../hoc/_Aux";
import "./../../../assets/scss/style.scss";
// import Dashboard from "../../Dashboard/Default";
// import route from "../../../route";
// import Pages from "../../../store/constant";
// import nav from "./Nav";
// import { Nav } from "react-bootstrap";

// const goHome = {
//   NavLink: "/dashboard/default",
// };

class SignIn1 extends React.Component {
  render() {
    return (
      <Aux>
        <Breadcrumb />
        <div className="auth-wrapper">
          <div className="auth-content">
            <div className="auth-bg">
              <span className="r" />
              <span className="r s" />
              <span className="r s" />
              <span className="r" />
            </div>
            <div className="card">
              <div className="card-body text-center">
                <div className="mb-4">
                  <i className="feather icon-unlock auth-icon" />
                </div>
                <h3 className="mb-4">Login</h3>
                <div className="input-group mb-3">
                  <input
                    type="email"
                    className="form-control"
                    placeholder="Email"
                  />
                </div>
                <div className="input-group mb-4">
                  <input
                    type="password"
                    className="form-control"
                    placeholder="password"
                  />
                </div>
                <div className="form-group text-left">
                  <div className="checkbox checkbox-fill d-inline">
                    <input
                      type="checkbox"
                      name="checkbox-fill-1"
                      id="checkbox-fill-a1"
                    />
                    <label htmlFor="checkbox-fill-a1" className="cr">
                      Remember Me
                    </label>
                  </div>
                </div>
                <button className="btn btn-primary shadow-2 mb-4 ">
                  <NavLink
                    to="/dashboard/default"
                    activeStyle={{ color: "white" }}
                  >
                    Login
                  </NavLink>
                </button>
                <p className="mb-2 text-muted">
                  Forgot password? <NavLink to="/auth/reset-1">Reset</NavLink>
                </p>
                <p className="mb-0 text-muted">
                  Donâ€™t have an account?{" "}
                  <NavLink to="/auth/signup-1">Signup</NavLink>
                </p>
              </div>
            </div>
          </div>
        </div>
      </Aux>
    );
  }
}

export default SignIn1;
